package HelloWorld;

public class RelationalOperator {

	@SuppressWarnings("unused")
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		// greater than >
		// grater than equal >=
		// Less than <
		// Less than equal <=
		// equal ==
		// not equal !=
		int num1,num2;
		num1 = 10;
		num2 = 15;
		System.out.println(num1>num2);
		System.out.println(num1==num2);
		System.out.println(num1>=num2);
		System.out.println(num1<num2);
		System.out.println(num1<=num2);
		System.out.println(num1!=num2);

	}

}
